func code64Cert(s string) string {
	return base64.StdEncoding.EncodeToString([]byte(s))
}

func decode64Cert(s string) (string, error) {
	d, err := base64.StdEncoding.DecodeString(s)
	if err != nil {
		return "", err
	}

	//r := base64.NewDecoder(base64.StdEncoding, strings.NewReader(s))
	//d, err := hex.DecodeString(r)
	//if err != nil {
	//	return "", err
	//}
	return string(d), nil
}

func parseCerts(dataCerts string) (map[string]string, error) {
	certs := make(map[string]string)
	err := json.Unmarshal([]byte(dataCerts), &certs)
	if err != nil {
		return nil, err
	}

	return certs, nil
}

